<!DOCTYPE html><html lang="ru">
<head>
    <link href="https://fonts.googleapis.com/css?family=Montserrat:300,400,700" rel="stylesheet">

  <style>
  *{
    margin: 0;
    padding: 0;
    -webkit-box-sizing: border-box;
            box-sizing: border-box;
  }

  h1{
    font-size: 2.5rem;
    font-family: 'Montserrat';
    font-weight: normal;
    color: #444;
    text-align: center;
    margin: 2rem 0;
  }

  .wrapper{
    width: 90%;
    margin: 0 auto;
    max-width: 80rem;
  }

  .cols{
    display: -webkit-box;
    display: -ms-flexbox;
    display: flex;
    -ms-flex-wrap: wrap;
        flex-wrap: wrap;
    -webkit-box-pack: center;
        -ms-flex-pack: center;
            justify-content: center;
  }

  .col{
    width: calc(25% - 2rem);
    margin: 1rem;
    cursor: pointer;
  }

  .container{
    -webkit-transform-style: preserve-3d;
            transform-style: preserve-3d;
    -webkit-perspective: 1000px;
            perspective: 1000px;
  }

  .front,
  .back{
    background-size: cover;
    box-shadow: 0 4px 8px 0 rgba(0,0,0,0.25);
    border-radius: 10px;
    background-position: center;
    -webkit-transition: -webkit-transform .7s cubic-bezier(0.4, 0.2, 0.2, 1);
    transition: -webkit-transform .7s cubic-bezier(0.4, 0.2, 0.2, 1);
    -o-transition: transform .7s cubic-bezier(0.4, 0.2, 0.2, 1);
    transition: transform .7s cubic-bezier(0.4, 0.2, 0.2, 1);
    transition: transform .7s cubic-bezier(0.4, 0.2, 0.2, 1), -webkit-transform .7s cubic-bezier(0.4, 0.2, 0.2, 1);
    -webkit-backface-visibility: hidden;
            backface-visibility: hidden;
    text-align: center;
    min-height: 280px;
    height: auto;
    border-radius: 10px;
    color: #fff;
    font-size: 1.5rem;
  }

  .back{
    background: #cedce7;
    background: -webkit-linear-gradient(45deg,  #cedce7 0%,#596a72 100%);
    background: -o-linear-gradient(45deg,  #cedce7 0%,#596a72 100%);
    background: linear-gradient(45deg,  #cedce7 0%,#596a72 100%);
  }

  .front:after{
    position: absolute;
      top: 0;
      left: 0;
      z-index: 1;
      width: 100%;
      height: 100%;
      content: '';
      display: block;
      opacity: .6;
      background-color: #000;
      -webkit-backface-visibility: hidden;
              backface-visibility: hidden;
      border-radius: 10px;
  }
  .container:hover .front,
  .container:hover .back{
      -webkit-transition: -webkit-transform .7s cubic-bezier(0.4, 0.2, 0.2, 1);
      transition: -webkit-transform .7s cubic-bezier(0.4, 0.2, 0.2, 1);
      -o-transition: transform .7s cubic-bezier(0.4, 0.2, 0.2, 1);
      transition: transform .7s cubic-bezier(0.4, 0.2, 0.2, 1);
      transition: transform .7s cubic-bezier(0.4, 0.2, 0.2, 1), -webkit-transform .7s cubic-bezier(0.4, 0.2, 0.2, 1);
  }

  .back{
      position: absolute;
      top: 0;
      left: 0;
      width: 100%;
  }

  .inner{
      -webkit-transform: translateY(-50%) translateZ(60px) scale(0.94);
              transform: translateY(-50%) translateZ(60px) scale(0.94);
      top: 50%;
      position: absolute;
      left: 0;
      width: 100%;
      padding: 2rem;
      -webkit-box-sizing: border-box;
              box-sizing: border-box;
      outline: 1px solid transparent;
      -webkit-perspective: inherit;
              perspective: inherit;
      z-index: 2;
  }

  .container .back{
      -webkit-transform: rotateY(180deg);
              transform: rotateY(180deg);
      -webkit-transform-style: preserve-3d;
              transform-style: preserve-3d;
  }

  .container .front{
      -webkit-transform: rotateY(0deg);
              transform: rotateY(0deg);
      -webkit-transform-style: preserve-3d;
              transform-style: preserve-3d;
  }

  .container:hover .back{
    -webkit-transform: rotateY(0deg);
            transform: rotateY(0deg);
    -webkit-transform-style: preserve-3d;
            transform-style: preserve-3d;
  }

  .container:hover .front{
    -webkit-transform: rotateY(-180deg);
            transform: rotateY(-180deg);
    -webkit-transform-style: preserve-3d;
            transform-style: preserve-3d;
  }

  .front .inner p{
    font-size: 2rem;
    margin-bottom: 2rem;
    position: relative;
  }

  .front .inner p:after{
    content: '';
    width: 4rem;
    height: 2px;
    position: absolute;
    background: #C6D4DF;
    display: block;
    left: 0;
    right: 0;
    margin: 0 auto;
    bottom: -.75rem;
  }

  .front .inner span{
    color: rgba(255,255,255,0.7);
    font-family: 'Montserrat';
    font-weight: 300;
  }

  @media screen and (max-width: 64rem){
    .col{
      width: calc(33.333333% - 2rem);
    }
  }

  @media screen and (max-width: 48rem){
    .col{
      width: calc(50% - 2rem);
    }
  }

  @media screen and (max-width: 32rem){
    .col{
      width: 100%;
      margin: 0 0 2rem 0;
    }
  }
  </style>
</head>

<body>
  <div class="wrapper">
    <h1>Продуктивные пользователи Pulse</h1>
    <div class="cols">
      <div class="col" style="display: none;" ontouchstart="this.classList.toggle('hover');">
        <div class="container">
          <div class="front" style="background-image: url(https://unsplash.it/500/500/)">
            <div class="inner">
              <p>#123542</p>
              <span>+ -</span>
            </div>
          </div>
          <div class="back">
            <div class="inner">
              <p>Инфо</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  </div>

  <script>
    let step = 0;
    let conteiner = document.querySelector('div.cols');
    let hidden = conteiner.querySelector('div.col');
    let clone = hidden.cloneNode(true);
    hidden.remove();
    clone.removeAttribute('style');

    document.addEventListener('DOMContentLoaded', function()
    {
      let mainData = getData();
      genPage(mainData.slice(0, 12));
      console.log(mainData.length);
    });

    function next ()
    {
      step = step + 12;
      conteiner.innerHTML = '';
      genPage(mainData.slice(step, 12));
    }

    function end ()
    {
      step = step - 12;
      if(step < 0) step = 0;
      conteiner.innerHTML = '';
      genPage(mainData.slice(step, 12));
    }

    function genPage (profiles)
    {
      //console.log(profiles);
      profiles.forEach(function(profile)
      {
        //console.log(profile);
        genCard(profile[0], profile[1]);
      });
    }

    function genCard (id, instrs)
    {
      //console.log(instrs);
      clone = clone.cloneNode(true);
      clone.querySelector('div.inner > p').innerText = '#' + id;
      clone.querySelector('div.inner > span').innerText = 'Покупок: ' + Object.keys(instrs).length;

      conteiner.append(clone);
    }

    function getData ()
    {
      let lzw = document.querySelector('script[type="lzw"]');
      if(!lzw) return [];
      lzw = lzw.innerText;
      lzw = lzw.trim();
      if(lzw === '') return [];
      lzw = lzw_decode(lzw);
      lzw = JSON.parse(lzw);
      return Object.keys(lzw).map((key) => [Number(key), lzw[key]]);
    }

    function lzw_encode(s,base=64)
    {
        if (!s) return s;
        var sym="ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789-_!#%()*+,./:;=?@[]^{|}~ $`";
        sym +="\1\2\3\4\5\6\7\b\t\v\f\16\17\20\21\22\23\24\25\26\27\30\31\32\33\34\35\36\37\xf7&'>\0\n\r\"<\\";
        var size=base*base*base;
        var d=new Map();
        var num=256;
        var logb=Math.log2(base);
        var s=unescape(encodeURIComponent(s)).split("");
        var word=s[0];
        var o=[];
        function pack(word) {
            var key=word.length>1 ? d.get(word) : word.charCodeAt(0);
            for(var n=(Math.log2(num)/logb|0)+1; n; n--) {
                o.push(sym[key%base]);
                key=(key/base|0);
            }
        }
        for (var i=1; i<s.length; i++) {
            var c=s[i];
            if (d.has(word+c)) {
                word+=c;
            } else {
                d.set(word+c,num);
                pack(word);
                word=c;
                if(++num==size-1) {
                    d.clear();
                    num=256;
                }
            }
        }
        pack(word);
        return o.join("");
    }

    function lzw_decode(s,base=64)
    {
        var sym="ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789-_!#%()*+,./:;=?@[]^{|}~ $`";
        sym +="\1\2\3\4\5\6\7\b\t\v\f\16\17\20\21\22\23\24\25\26\27\30\31\32\33\34\35\36\37\xf7&'>\0\n\r\"<\\";
        var size=base*base*base;
        var symd={};
        for(var i=0; i<base; i++){
            symd[sym.charAt(i)]=i;
        }
        var d=new Map();
        var num=257;
        var logb=Math.log2(base);
        var logn=8/logb|0;
        var i=0;
        function unpack(pos=0) {
            return symd[s[i++]]+(pos==logn ? 0 : base*unpack(pos+1));
        }
        var word=String.fromCharCode(unpack());
        var prev=word;
        var o=[word];
        while(i<s.length) {
            logn=Math.log2(num++)/logb|0;
            var key=unpack();
            word=key<256 ? String.fromCharCode(key) : d.has(key) ? d.get(key) : word+word.charAt(0);
            o.push(word);
            if(num==size-1) {
                d.clear();
                num=256;
            }
            d.set(num-2,prev+word.charAt(0));
            prev=word;
        }
        return decodeURIComponent(escape(o.join("")));
    }

    
    












  </script>
